import React from 'react'
import { Link } from 'react-router-dom'
import styled from 'styled-components'


const CoachingServices = () => {

  return (
    <Wrapper>
      <div className='section-center'>
        <div className='title'>
          <h2>Individualized Services</h2>
          <div className='underline'></div>
        </div>
        <div className='services-center'>

          <article className='service'>
            <h4>Individualized training program</h4>
            <ul>
              <li>
                Fully Individualized Program
                  </li>
              <li>
                Any lenght(Min 6 weeks)
                  </li>
              <li>
                Check ins after 1st and last week
                  </li>
            </ul>
            <Link to='/contact' className='btn'>
              Get Started
      </Link>
          </article>

          <article className='service'>
            <h4>All access coaching</h4>
            <ul>
              <li>
                Fully individualized program
                  </li>
              <li>
                Weekly/monthly program updates
                  </li>
              <li>
                Weekly feedback and support
                  </li>
            </ul>
            <Link to='/contact' className='btn'>
              Get Started
      </Link>
          </article>
        </div>
      </div>
    </Wrapper>
  )
}

const Wrapper = styled.section`
h3,
h4 {
  color: var(--clr-primary-1);
}
padding: 5rem 0;

background: var(--clr-primary-10);

.header h3 {
  margin-bottom: 2rem;
}
p {
  margin-bottom: 0;
  line-height: 1.8;
  color: var(--clr-primary-3);
}
.services-center {
  margin-top: 4rem;
  display: grid;
  gap: 2.5rem;
}
.service {
  background: var(--clr-primary-7);
  text-align: center;
  padding: 2.5rem 2rem;
  border-radius: var(--radius);
  p {
    color: var(--clr-primary-2);
  }
}
span {
  width: 4rem;
  height: 4rem;
  display: grid;
  margin: 0 auto;
  place-items: center;
  margin-bottom: 1rem;
  border-radius: 50%;
  background: var(--clr-primary-10);
  color: var(--clr-primary-1);
  svg {
    font-size: 2rem;
  }
}
@media (min-width: 992px) {
  .header {
    display: grid;
    grid-template-columns: 1fr 1fr;
  }
}
@media (min-width: 750px) {
  .services-center {
    grid-template-columns: repeat(2, minmax(200px, 1fr));
  }
}
@media (min-width: 1280px) {
  padding: 0;
  .section-center {
    transform: translateY(5rem);
  }
}
`

export default CoachingServices
